Who would love a quiet afternoon with you gardening in the shire and be ready on a moments notice to accompany you on a grand adventure? Samwise, of course! Sam is earnest, rustic almost, and he wears his heart of gold on his sleeve. Sam will look to you to be his leader and he will be the secret strength that carries you though even the toughest of days. His resilient spirit has allowed him to travel from humble beginnings with no place of his own to winning the hearts of the rescue volunteers who have been teaching him the ways of people and the comforts of home. Imagine the joy of never having to feel guilty knowing that your best friend would rather to be home with you than at the dog park.
Sam is now looking for his forever place in the country with a fenced yard, quiet surroundings, and an experienced dog lover who prefers the road less traveled for times when a hike is the order of the day. How much fun will it will be walking the solitary back roads on a Tuesday morning at 10 when everyone else is&hellip; well... too busy to seize the warm sunny moment you&rsquo;ll share.
Sam is housebroken, crate trained, knows sit, and certainly knows breakfast and dinner routines. He enthusiastically loves to lean-in and he is a first class snuggler who will not be shy about joining you on the sofa to savor a movie&hellip; or three. Sam is ready for the unconditional love of a friend who will teach him even more about the ways of people. In return he will promise to do his very best to listen to your stories, his eyes meeting yours in agreement that life&rsquo;s journey is difficult and worthy and fun and glorious but not all at once. All the while Sam will share with you the rewards of investing in love.
FENCE REQUIREMENT:&nbsp; Sam is going to need a yard with a privacy fence that is at least 4 foot&nbsp;high.&nbsp;&nbsp;
&nbsp;
If you are interested in Sam, please contact:
 rorrcanine@gmail.com  &nbsp; &nbsp;
