DOB: 3/20/2015. Midnight is very sweet and enjoys being pet. She also loves to talk! &nbsp;Midnight loves food and likes to follow her people around. &nbsp;She would do best in a home with one or two other cats or be the only cat in the home. &nbsp;Midnight was a great mother to her 5 kittens, and we are excited for her to get her turn and find a forever home, too!&nbsp;

Like all Leon County Humane Society cats, this one is already spayed or neutered, up-to-date on vaccinations, microchipped, and tested for FIV and Feline Leukemia.

My Sponsor(s): No one yet!

Donny is very sweet but gets very verbal and loud when telling you that he wants your attention, but he doesn&rsquo;t want to be snuggled. And if he has something to say he will trot right up to you and carry-on a conversation and when he has said his piece just walks away.

He&nbsp;is calm and friendly and is never aggressive with any other pet family members and he nurtures and grooms his favorite elderly cat.

At night if he sleeps close to your head he will reach his paw out to touch you while you fall asleep and then moves to sleep on your legs or hips. His fur is very soft like a bunny.

Donny likes to jump to high places and back down. He will even jump on your back and use you as a bridge to get somewhere else. &nbsp;

If Donny is of interest please email and share about yourself and others in the home as well as other pets. He will be happy in a home without children but other cats would be fine.

Donny is being cared for by Community Animal Network, a non-profit organization founded by DiAnna Pfaff-Martin in 1996. C.A.N is a veterinary medical rescue that prepares dogs and cats for forever homes. &nbsp;

To donate to help cats like Buddy,&nbsp;use our PayPal link: www.PayPal.Me/CommunityAnimal Or Mail checks to: Community Animal Network P.O. Box 8662 Newport Beach, CA 92658&nbsp;&nbsp;

Baby Brown is an affectionate soul with a sweet face. All she wants is to be loved. &nbsp;She is attentive and walks closely beside your leg. &nbsp;She is eager to please and simply needs someone to spend time teaching her specific skills.&nbsp; She would appreciate a home with older, more considerate children.&nbsp;



She is friendly towards other dogs, but may not be suited for a household with cats or other very small animals. &nbsp;Her adopter should be sure to get her squeaky teddy bear, which is very important to her.



She is beyond ready to go to her new home!! A fenced yard is required.&nbsp;



&nbsp;

NG

Cassandra is a medium hair grey and white female cat who came from AHS. &nbsp;Her owner surrendered her. &nbsp;Cassandra&#39;s&nbsp;attitude is still there, she did lash out at Judy after too much petting but not aggressively. She is adjusting finally to being a house cat. Judy says she has bonded and is more comfortable with her and even ventured to Judy&#39;s bed to sleep with her. Her name is now Missy and likes the new food she is eating, Sheba and some dry food but not much. She prefers wet food over dry. Right now her favorite place to relax is a plastic bin in the kitchen and loves her toy ball on the cat tree. She is at her forever home, never to come back to a shelter.

She was returned due to her aggressive behavior 6/3/2021

&nbsp;

Tucker is a super handsome 3 year old love bug! He was adopted as a puppy but unfortunately as he aged, he did not do so well with the children in the home so he is now back with us at Eleventh Hour! Tucker needs an adult only home (or with older kids)&nbsp;who understand when to give a dog his space. Tucker has given us nothing but love and affection at the kennel so he proved to us how sweet he can be. &nbsp;He isn&rsquo;t a huge fan of dogs but he DOES get along with CATS. He is currently in foster care with TWELVE CATS!&nbsp;Tucker lived with a female puppy (11 months old) but he did not like her too much. We believe he may be good with a calm, submissive female, or best as an only dog.&nbsp;
He is would be a great fit for a quieter low-traffic household.

If you are interested in Tucker, please visit EHDOGS.ORG to fill out an application and be sure to mention TUCKER (DAX ALABAMA)!!!

Whiskey originates all the way from Kansas City! She landed herself on the euthanasia list at an overwhelmed shelter and DRM stepped in to rescue her.&nbsp;

Whiskey is a special girl who has some anxiety, which is controlled with inexpensive meds and she&nbsp;is comfortable in her foster home where she has the structure she needs to thrive. Her foster family and DRM have devoted to keep Whiskey in the program where she will be cared and loved for the rest of her life. There is nothing in the world that Whiskey loves more than her Kong, so if you can, send some her way!

