DOB est 6/1/2012...&nbsp; &nbsp;Junior is a SUPER sweet boy.&nbsp; He came from a hoarder situation where the cats lived in a basement for years with no litter boxes and one light bulb.&nbsp; In spite of that situation they were very healthy and friendly.&nbsp; Junior is laid back and friendly.&nbsp; Junior craves your attention.&nbsp; Be careful as he insists on rubbing your legs and could trip you up.&nbsp; He loves to be petted on.&nbsp; Junior is a lap cat.&nbsp; Despite not having litter boxes most of his life he has never had an issue using the litter box since being in foster care.&nbsp; Where he came from the people loved on him so he is very affectionate.&nbsp; He has not had any health issues since being in foster care as of February 2017.&nbsp; Junior was one of the first cats rescued the first day we went to the hoarder situation.&nbsp; He has never looked back.&nbsp;&nbsp;

&nbsp;

Name: Birdo
Age: 4/17/17
Gender: Female
Breed: Anatolian x
Weight: 85
Dog friendly: Yes
Cat friendly: TBD
Kid friendly: Yes, 10+
House Trained: Yes
Crate Trained: Yes but doesn&#39;t need to be
Energy level: Moderate
History: Pulled from an animal control
Adoption Fee: $500.00

&nbsp;

From the Foster:&nbsp;

I have known Laika (Formally known as Birdo)&nbsp;and her prior owners since puppyhood.&nbsp; She had to be returned to rescue through no fault of her own, and I am happy to act as her foster home now to find her the best forever family.&nbsp; &nbsp;She loves to play with our resident dog. Even though she is twice his size she rarely overpowers him.&nbsp;

&nbsp;

She is house and crate trained, however I have not had her in a crate at all. No accidents in the house ever.&nbsp;

&nbsp;

She is well behaved when left alone in the house except for barking at sights and sounds outside. We are working on this, however, it can be alleviated if she can be in an area where she cannot see outside the window.&nbsp;

&nbsp;

She does not like strangers but will warm up to them after period of time where she can observe them and get used to their presence.&nbsp;

&nbsp;

She requires a home that does not have small children. Age 10 and above are fine as long as they are educated to be her kind and gentle leader.

&nbsp;

Anatolian shepherd is a guardian breed and as such she is inclined to guard any space that she is in including her backyard. We are working on training her to accept that the next-door neighbors are OK to be in their own yard and not to bark at them.&nbsp;

&nbsp;

She would love a home that has a spacious fenced in yard where she can be outside for long periods of time while her people are home. She has a heavy winter coat and loves to stay outside in the winter for hours at a time. Her previous owner would snow blow the snow into a mountain for her to sit atop in the backyard.

&nbsp;

She loves to touch base with her people with brief cuddle sessions, but otherwise prefers to relax in a separate space.&nbsp;

&nbsp;

She is anxious when in new surroundings, which results in a lack of appetite and may seem confused about what she is supposed to do. Patience and gentle guidance will get her through it. After about 4 weeks here, she has a normal appetite and has learned our daily routine. She likes to be in whatever room you are in. She responds more readily, to &ldquo;no bark&rdquo; and &ldquo;come&rdquo;, though not perfectly. She is not food and treats oriented so patience and consistent follow-through are the key to training her.&nbsp;

&nbsp;

She is ultimately a sweet dog and GREAT companion&nbsp;

&nbsp;

Kona&#39;s story: Kona came to the Stafford SPCA back in 2017 as a tiny kitten. For the past three years she had been living in her home. Up until recently, things had been going great, until a dog was brought into the home and they were not a good match. Kona loves to be held like a baby, getting chin scratches and having nice perch to look out of the window and watch the birds and squirrels!

Kona is our current office kitty, as she can be a bit of a bully to others. She loves all the attention she gets from staff in the office. Some of her favorite things to do are walk on top of the cubicle walls around the office to say &quot;hello!&quot; to everyone, try and catch skins, and sleeps in the middle of the floor where everyone is trying to walk. She also cannot drink water with out getting it all over her face. She is quite the character!&nbsp;&nbsp;

&nbsp;

Are you the perfect forever home for Kona?

