Gender: Female

Spayed/Neutered: Yes

Weight: 10.5&nbsp;lbs

Vaccines: Rabies, Distemper&nbsp;

FiV/FeLV results: negative

OK with cats: No

OK with children: yes

OK with dogs: If they leave her alone, she will leave them alone.&nbsp;

Adoption fee: $100

