Gunnar feels as if it&#39;s ladies&#39; night every night! That&#39;s right, ladies, Gunnar is a ladies&#39; man! This stunning white knight has all the love to give that one special lady. Gunnar can be selective of men and needs time to decompress and learn to trust a man. Unfortunately, Gunnar can&#39;t talk and tell us why he is so unsure of men. Probably better, we are sure it would break our hearts. Gunnar definitely does not want to share your love.&nbsp;
Gunnar likes to be the ladies man with his doggie companions also! No kids, cats, does best with playful female dogs his size. 


Gunnar was removed from his previous owner for neglect, living day in and day out in the elements with no shelter, and extremely emaciated. But those days are behind him! Gunnar is 6 years old and about 55 pounds.

If you would like to adopt Gunnar, please put your application in here: http://www.rescuedogsrocknyc.org/general-application

