Fluffy, short-legged sweetheart. Front paw declaw. Just a loving girl! Owner relinquished. Since she was a former Catsnap kitty we of course took her back in the program. Starved for love!

&nbsp;

Thank you for your interest in a Catsnap cat or kitten! If you would like to meet a cat, please complete the online application located on our website catsnap.org. We do not have a walk-in facility; most of our cats are in foster homes. For this reason, we require an approved application on file before we set up a meet and greet. Completing an online application does not obligate you to adopt! We care deeply about our cats and want the best match for all involved. Vaccination against Panleukopenia (Distemper), Rhinotracheitis, and Calicivirus [cats]&nbsp; Vaccination against Rabies (if animal is over 4 months of age) Testing for Feline Leukemia (FeLV) and Feline Immunodeficiency Virus (FIV) [cats]&nbsp; Initial de-worming, flea, and ear mite treatment Sterilization of the animal prior to adoption; no exceptions Micro-chipping as mandated by state law

