2 Shuz is super friendly and just wants to play with everybody.&nbsp; She does settle down and would probably be fine with an older person or small kids.



Update:&nbsp; 5/31/20&nbsp; 2 Shuz is still available for adoption but her caretaker would prefer that she and Sox be adopted together.&nbsp; 2 Shuz is about 3 1/2 yrs old now.


