Adoption fee includes spay/neuter, microchip, age appropriate vaccinations, Feline Leukemia &amp; FIV testing &amp; de-worming. &nbsp;We ask that our cats remain indoor cats unless otherwise stated &amp; agreed upon &amp; do not allow declawing -click here&nbsp;if you would like to learn more about why we do not support declawing. &nbsp; We are a smaller group that typically takes on harder cases that require special homes so we ask that applicants live in our area - if you do not live in the MN or surrounding states, please contact us via email before submitting an application to determine whether the animal you are interested in is a case we are comfortable adopting out to a family out of our area.

Atlas is ready to be the king of your world! This handsome young bridle boy is around 3.5 years old and happiest when he&#39;s running and playing fetch.&nbsp; Atlas is well trained and knows how to sit, shake, stay, lay down, wait, come, leave it and get up. Atlas is also muzzle trained, he prefers to wear this when meeting strangers or doing scary things like visiting the vet&#39;s office.&nbsp;

Atlas would thrive in an active home with adults only who are dog savvy and maintain a relatively quiet home life. We don&#39;t know all of his background, but we know that strangers in the home are scary to Atlas and he isn&#39;t sure if he&#39;s supposed to protect you from them or not!&nbsp;&nbsp;Atlas loves to play, so another playful dog in the home would make for a perfect match! Atlas is kennel and potty trained, and also loves to give kisses. A 4-6 foot high fenced in yard would be a dream come true for ol&#39; Atlas, here he could run and play to his hearts content and maybe learn some more impressive commands with a little help from his new family.

If you are interested in learning more about Atlas please complete an adoption application for consideration at www.AdoptHope.org.&nbsp; The adoption fee for Atlas is $250 and includes his neuter, microchip, current vaccinations and preventatives as well as a FREE obedience class through Cedar Run in Hiawatha.&nbsp; Our adoption process includes reference and background checks, a vet check and home visit.

&nbsp;

Snowflake is a loveable and affectionate 10 yr old&nbsp;girl who is a total house dog, just wanting to be inside with her family as a companion and protecter.&nbsp;She is a&nbsp;happy girl&nbsp;with a tail that curls prettily over her back and wags happily when she sees her person, a leash or food bowl. She loves morning and evening&nbsp;walks.&nbsp;&nbsp;She gets along with other dogs and can be bouncy and playful with them but would be&nbsp;content as either an only dog or with another dog her own size.&nbsp;She is house trained, crate trained and respectful of property. She is very mellow overall but can get crotchety with young dogs who are disrespectful.&nbsp;She knows her basic commands and walks well on leash with a training collar. Snowflake loves playing in the yard, car rides and running errands with her person. She is a perfect companion dog who is non-intrusive when you are busy. She has not been around children so would do best in an adult home&nbsp;without cats.


If you are interested in meeting any of our dogs please complete an adoption or foster application on our website at&nbsp; 
www.happyheartsgsr.org
.&nbsp;&nbsp;Also please follow us and get the latest updates on our dogs on facebook at&nbsp; 
www.facebook.com/HappyHeartsGSDRescue
.


