Winter is one of the most stunning kits with piercing blue eyes.&nbsp; She is a special little girl that needs a family or person&nbsp; 
&nbsp;

that has dealt with shy, timid cats, and is willing to go the extra mile to help her become the best pet she can become. &nbsp;She shies away from people, but in a quiet environment, we think she&#39;d come around in time. &nbsp;If you&#39;re one of those people that can meet a cat on their own terms, and be happy with the small successes you experience, please consider helping Winter.&nbsp;&nbsp;

Here at Adopt-A-Dog, Fry serves the role of class goofball very well.&nbsp;Effusive in both his love for his friends and in every experience he has, Fry is one of a kind. He takes to new experiences, such as learning how to play soccer or football, or going for a ride in the Adopt-A-Dog van, with an enthusiasm that cannot be matched. He truly is a unique dog and has most of his human friends saying &quot;Oh, Fry!&quot; or &quot;That&#39;s Fry for you&quot; whenever he does something just a bit more awkward than his counterparts.

A big guy, Fry came to our shelter when his original family could not handle his size. At the time, he had not reached a year old so he still had both growing and learning to do. We began working with Fry on basic obedience and his manners when it came to both people and other dogs. The Fry we have today has come a long way from the Fry we first met, and we know he is ready to show off for his very own family. When making new friends, Fry typically needs a bit more time to get comfortable and get to know someone. Once he has spent some time with you, and has been feed a copious amount of treats, Fry will be your best bud.&nbsp;

&nbsp;All this big guy needs in a home is a willingness to get slobbered on followed by tons of comfortable places to sleep and stretch out. We know that this not-so-small Fry is ready for his new family.&nbsp;

For more information, please contact us at (914) 273-1674 or adoptions@adoptadog.org.

&nbsp;If you are interested in adopting Fry or any of our other adoptable dogs, please fill out the following online application here:&nbsp;&nbsp;

https://forms.gle/pnkaGTG8Cy4dgQRJ8

You meet Ernie, you can&#39;t help but fall in love with him.&nbsp; Ernie was a stray hanging out around one of our volunteer&#39;s neighborhoods.&nbsp; She took him to the vet to be neutered and found out he&#39;s FIV+.&nbsp; Ernie should live in a home so he will have a less stressful life than on the streets.&nbsp;

&nbsp;

Ernie is in a foster home at this time.&nbsp; He gets along with dogs and cats.&nbsp; If you&#39;d like to meet him, fill out our online adoption application at:&nbsp; https://colonycats.org/adoption_app.html . He&#39;s neutered, microchipped, FL negative and up to date on vaccines.&nbsp; DOB&nbsp; Feb 2014

&nbsp;




For more information about FIV &ndash; feline immunodeficiency virus visit this website: https://bestfriends.org/resources/fiv-cats-faqs-feline-immunodeficiency-virus




GW

Ted is a petite brindle boy with lots of love to give. He loves to just cuddle on the couch with his person and sleep or he loves to&nbsp;be outside going for a walk. He loves kids, and with a slow introduction to dogs, he has done well.&nbsp;


He doesn&#39;t need to be crated during the day so&nbsp;if he is&nbsp;left out with his fur siblings, he does amazing. He hasn&#39;t been cat tested, so we aren&#39;t sure how he would react.&nbsp;

&nbsp;

He is all together a wonderful dog. He&#39;s excelled well with his foster family and neighbors kids.&nbsp;

Personality: 
&nbsp; Miss Reagan appreciates a more quiet, one on one environment. She is&nbsp;quite a snuggler and will take in all the loving and attention you want to dole out.&nbsp;Don&#39;t&nbsp;be fooled by that&nbsp;though because she can be an escape artist and will not go to a home with a chain link fence. It&#39;s best she have a 6 foot privacy fence or no fence at all with leash walks. She will do great as the only dog or maybe with a buddy but that buddy will not be a cat or any other small breed or prey. She is a confirmed cat killer. Spunky Girl when she wants to be but is great inside and settles down beautifully.




None of our foster dogs are tested with cats because we have no way of testing them with cats. Siberians are notorious for their high prey drive and typically kill cats, rabbits, chickens,&nbsp;birds, squirrels, opossums, etc., so we don&#39;t have much success adopting them out to homes with cats. Most of our foster dogs are with us for killing cats, chickens and goats to begin with so our assumption is they are not good with cats and other small things that move.&nbsp;








Siberians are typically good with children of all ages and the only reason we would not list them as not good with kids is because they may be too energetic and bouncy and knock over a toddler.







Southern Siberian Rescue is a volunteer based 501(c)3 organization based out of Raleigh, NC, so we do not have a physical facility with operating hours&nbsp;that you can visit to meet our dogs. All of our foster dogs are in our personal homes.&nbsp;You need to fill out&nbsp;our adoption application (http://www.southernsiberian.com/info/adoption)&nbsp;and get approved to adopt and then we will set a time for you to meet our foster dogs. As a volunteer based group, we all&nbsp;have jobs, family, personal dogs and other commitments but we try to acknowledge and process applications as quickly as we can. That being said, we try to keep our available foster dogs as current as we can also but it is time consuming to get pics and information on new dogs so not all of our dogs are listed at all times. Please fill out our application and then we can discuss dogs that will work for you and your situation. We average 40-45 Siberians in our program so we are certain we have one that will work for you. Please know that we are not obligated to answer inquiries on dogs as we will focus on&nbsp;approved applicants. Again, there is ample time to discuss all of our foster dogs AFTER we have an approved application on file. We do adopt out of state as long as we can get a home check done. We ask that you, your family and existing pets make the trip to NC to meet and adopt our foster dogs.&nbsp;



SSR can not and will not hold dogs for anyone. If we do, that means another Siberian will die in a shelter because a shelter dogs time is very limited, as is our foster space. We do our best to process applications in the order received and first application gets first interest in our foster dog(s). We understand that there will be scheduling conflicts with home checks and meet and greets but we will try to accommodate for that if a potential adopter has interest in a particular foster dog in our program.




All Southern Siberian Rescue foster dogs are microchipped, up to date on shots, spay/neutered,&nbsp;on monthly heartworm preventative and flea and tick preventative. For additional information on Southern Siberian Rescue and Siberian Huskies, please visit www.SouthernSiberian.com. 





To fill out an application, please visit 

http://www.southernsiberian.com/info/adoption&nbsp;


