Meet beautiful Pansie! She is a Pit Bull&nbsp;mix who was born in 2014 and weighs about 40 pounds. She was rescued off the streets of Texas with a horrific case of mange. This poor baby was a sight for sore eyes, she&nbsp;hardly had any hair left and her skin was raw and infected. We made sure she got immediate medical care and&nbsp;Pansie is doing awesome now! Her fur has almost grown back completely but it may take awhile longer to get her coat back to 100% because of how severe her condition originally was.&nbsp;&nbsp;She is spayed, up to date on vaccines, and is great with people of all ages and does well with other dogs with slow intros. Her foster mom says that she loves her people very much and is so sweet! She&nbsp;would do well in a home with slow intro to other dogs or could live as an only dog as she loves affection from humans. Pansie is house trained, crate trained, loves toys to chew on, enjoys walks and car rides, and is wonderful with kids!&nbsp;Pansie is long overdue&nbsp;for&nbsp;her happy ever after and we are rooting for this sweetheart&nbsp;big time! She deserves so much more than the life of neglect that she had to&nbsp;suffer&nbsp;through for so long. If&nbsp;you would like to make Pansie the newest member of your family and love of your life,&nbsp;please fill out an adoption application here:&nbsp;http://www.rescuedogsrocknyc.org/general-application&nbsp;

