Personality: 
&nbsp;&nbsp;




None of our foster dogs are&nbsp;tested with cats because we have no way of testing them with cats.&nbsp;Siberians are notorious for their high prey drive and typically kill cats, rabbits, chickens,&nbsp;birds, squirrels, opossums, etc., so we we don&#39;t have much success adopting them out to homes with cats. Most of our foster dogs are with us for killing cats, chickens and goats to begin with so our assumption is they are not good with cats and other small things that move.&nbsp;





Siberians are typically good with children of all ages and the only reason we would not list them as not good with kids is because they may be too energetic and bouncy and knock over a toddler.




Southern Siberian Rescue is a volunteer based 501(c)3 organization based out of Raleigh, NC, so we do not have a physical facility with operating hours&nbsp;that you can visit to meet our dogs. All of our foster dogs are in our personal homes.&nbsp;You need to fill out&nbsp;our adoption application (http://www.southernsiberian.com/info/adoption)&nbsp;and get approved to adopt and then we will set a time for you to meet our foster dogs. As a volunteer based group, we all&nbsp;have jobs, family, personal dogs and other commitments but we try to acknowledge and process applications as quickly as we can. That being said, we try to keep our available foster dogs as current as we can also but it is time consuming to get pics and information on new dogs so not all of our dogs are listed at all times. Please fill out our application and then we can discuss dogs that will work for you and your situation. We average 40-45 Siberians in our program so we are certain we have one that will work for you. Please know that we are not obligated to answer inquiries on dogs as we will focus on&nbsp;approved applicants. Again, there is ample time to discuss all of our foster dogs AFTER we have an approved application on file. We do adopt out of state as long as we can get a home check done. We ask that you, your family and existing pets make the trip to NC to meet and adopt our foster dogs.&nbsp;



SSR can not and will not hold dogs for anyone. If we do, that means another Siberian will die in a shelter because a shelter dogs time is very limited, as is our foster space. We do our best to process applications in the order received and first application gets first interest in our foster dog(s). We understand that there will be scheduling conflicts with home checks and meet and greets but we will try to accommodate for that if a potential adopter has interest in a particular foster dog in our program.




All Southern Siberian Rescue foster dogs are microchipped, up to date on shots, spay/neutered,&nbsp;on monthly heartworm preventative and flea and tick preventative. For additional information on Southern Siberian Rescue and Siberian Huskies, please visit www.SouthernSiberian.com. To fill out an application, please visit

http://www.southernsiberian.com/info/adoption 
.
&nbsp;

Meet Stu! He&#39;s a great dog with a big heart and whose favorite things to do is cuddle and receive belly rubs. He can be playful too so a fenced yard would be a plus but is not required, with a couple quick walks each day he does just fine. Stu currently lives with two other dogs and is fine most of the time &quot;occasionally rude to male&quot; but he does not do well with cats. He is food reactive and would do best in a home with kids 13 yrs. or older. He has some separation anxiety but that has been easy managed with proper medication. Stu is very well socialized with people, is eager to please and is food motivated. He is smart and responds well to training. He knows sit, wait, release command (&ldquo;okay&rdquo;) and does well on a harness lead for walks. He is about 6.5 years old and crate and house trained.

Stu&rsquo;s adoption fee is $175; he is neutered, microchipped, and up-to-date on all of his vaccines. If you are interested in meeting Stu, please contact us at adoption@ihadro.org or, you can find an adoption application at www.ihadro.org/forms

&nbsp;

Shelly, a beautiful Pittie, was rescued from Manhattan ACC where she had been brought in as a stray, with broken teeth and was emaciated at only 24 pounds!!&nbsp; She is thought to have been born in 2015.&nbsp; 

Her foster mom has been taking such good care of her and despite her obvious neglect, Shelly remains a&nbsp;very sweet and loving girl, she

&nbsp;is super smart and would do well in a suburban home&nbsp;with a fenced yard and an active family who can devote time to her and to&nbsp;make sure she gets enough of her favorite activity. . . chasing tennis balls!&nbsp; She

&nbsp;is great with kids and people of all ages. She does not do well with cats, and slow introductions are&nbsp;required if there are other dogs in the home.

Shelly
&nbsp; 
is spayed, up to date on vaccinations, housebroken, crate trained and knows basic commands.&nbsp;

Please apply online if you are interested in adopting Shelly:&nbsp;http://www.rescuedogsrocknyc.org

&nbsp;&nbsp;


&nbsp;

&nbsp;


