Beethoven is the perfect age for a pit bull at around 6&nbsp;years old. He is smart, house trained, crate trained and fantastic in the car. He is good on a leash and would do just about anything for a treat or a tennis ball. Beethoven is deaf but that doesn&#39;t slow him down. If anything he is more attentive than hearing dogs because he looks to his person for direction. Beethoven knows sign language and is a velcro dog: wherever his person is, that is where he wants to be. Beethoven loves the water and will spend hours splashing in a baby pool. This sweet guy would make a great running buddy or agility dog. Beethoven would prefer to be the only 4 legged member of your family! His favorite spot is on the couch..... UNDER the blankets! Looking for a couch buddy??? Apply to adopt Beethoven today!
Beethoven is neutered, up to date on age appropriate vaccinations, microchipped and heartworm tested and on preventative. His adoption fee is $200.&nbsp;
To apply to adopt Beethoven, visit www.adoptapitrescue.org/apply

