Rainey is an extremely social cat. Her favorite things are petting and watching the bird feeder that hangs outside a window. She loves petting and will &ldquo;drop and roll&rdquo; to show her belly when she wants attention and will also seek out a lap when wanting to be close. Her sister Breezy (Bengal Tabby) is Rainey&rsquo;s favorite playmate.&nbsp; Both kitties love interactive play and are compatible playmates. &nbsp;Having a pair of cats that are good playmates is a healthy alternative to a sedentary lifestyle for indoor cats.

&nbsp;

Visit our website at: www.animalnetwork.org to see our fees, adoption requirements and to view other available animals we have for adoption. Email: contact@animalnetwork.org for the application to adopt and tell us a little about your family&rsquo;s lifestyle and home. Some of the new arrivals can be seen in the caregiver&rsquo;s homes on weekdays. A mandatory pet parenting class is given on Saturdays so you can learn how to introduce your new pet to existing ones, teaching house manners, recommended foods and the best litter, and what you can do to avoid your cat from getting certain diseases. If you can&rsquo;t find the pet that you are looking for sign up for our &ldquo;Pet Match Service&rdquo; and tell us what you are looking for. A $25 donation is accepted for this 1 year service.

Looks AND voice!!&nbsp; Nick is a stunning little house leopard with the personality of a teddy bear.&nbsp; Nick was born in the summer of 2017 and lives with his foster mom Robin.&nbsp; He loves to play with the other cats and snuggle his foster mom at night.&nbsp; He may be a little shy on the first date, but give him time&nbsp;and he can&nbsp;be your best bud! &nbsp;

He has&nbsp;tested negative for FIV/Felv, has had worm and flea treatment and his distemper shots. He has&nbsp;been&nbsp;neutered and has his&nbsp;rabies shot. His adoption donation&nbsp;is $65.

If you are interested in Nick, please call or text Robin at 717-612-2840.&nbsp;

Thank you for considering the adoption of a rescued cat! Loving Care Cat Rescue is a No-Kill organization that helps cats in need. There are Loving Care foster homes throughout southcentral PA helping unwanted cats and kittens find new forever homes.

&nbsp;


Sweet Carly finds herself needing an adopter through no fault of her own.&nbsp; Her owner has faced some lifestyle changes that no longer allow her to care for Carly.&nbsp; Carly is a friendly, loving, energetic girl who would love a yard to play in - or at least a lot of exercise every day - and a human to hang out with most of the time.&nbsp; She loves long walks, but can help you work from home, as well.&nbsp; She is great with people, but a bit excitable around children, so we recommend older children only.&nbsp; Carly would love a sibling to play with, someone around her size is best.&nbsp; Carly is about 3 years old, approximately 40 lbs, and up to date on vaccines.&nbsp; If you are looking for a best friend, Carly is your girl!&nbsp; If you would like to adopt Carly,&nbsp; please put your application in here: 
http://www.rescuedogsrocknyc.org&nbsp;

&nbsp;
