Although we do our very best to make sure your new pup is in tiptop health before adoption, things could drastically change a month later.&nbsp; Since we don&rsquo;t have a long health history of your adopted dog, we can only treat her&nbsp;for whatever symptoms that present during the initial exam and follow up exams. - - 


Health:&nbsp;When Bubbles first came into our rescue (early 2018)&nbsp;a benign mass was&nbsp;removed&nbsp;from her neck. She&nbsp;also was&nbsp;successfully treated&nbsp;for heart worms and&nbsp;numerous parasites.&nbsp; This girl was very sick when we first received her.&nbsp;

*****On April 24th, she was diagnosed with an enlarged heart.&nbsp; She is on Lasix and Enalapril twice a day for the rest of her life. Initially it was difficult to administer her medication. She now enjoys her medication when it is put into a small bit of liverwurst and offered as a &quot;treat&quot;.&nbsp; *****&nbsp; &nbsp; No other obvious health issues have been diagnosed. - -


Temperament: She has only been used for breeding, so she is more comfortable being with dogs than people. &nbsp;It will take some time and patience for her to learn that people can be nice.&nbsp; If you decide to adopt Bubbles, I hope you will consider that 
it will take&nbsp;some time 
before she becomes the lap dog you might be hoping for.&nbsp; &nbsp;Bubbles has been seriously mistreated her whole life.&nbsp; She is not going to trust you immediately.&nbsp; Please don&#39;t apply to adopt her unless you are very serious about putting in the time it will take to help her adjust&nbsp;to a &quot;normal&quot; dog life.&nbsp; -----------------------------------------------------------

She has never bitten anyone but she does run from you when she is outside and she will back herself into a corner when you reach for her inside. &nbsp;When you reach down to pick her up, she&nbsp;will throw her front paws up in the air and it almost looks like a small child reacting to someone picking them up. &nbsp; It would be funny except that she does it out of fear. &nbsp; I believe 
it will take a very long time for bubbles to relax and enjoy being part of the family.
She will not be easy but it will be very rewarding when she comes to you for a treat and to enjoy some ear&nbsp;scratching for the first time. Update 7/1/2019 Bubbles still retreats if you go to get her; however, she is starting to come and laydown and relax near her foster family daily especially if another dog is already there. She likes to be on the sofa and bed and will use dog steps to get up and down from the bed.&nbsp; --------------------------

Bubbles knows how to use a doggie door.&nbsp; She is crate trained as well.&nbsp; She is walking very well on a leash hooked to her collar or harness.&nbsp; She likes the harness the best and it&#39;s the safest way to walk her.&nbsp; She is most cooperative when walking alongside other confident dogs but she will walk by herself too.&nbsp; She will just be more on alert.&nbsp;

Where did she come from: She came from puppy mill closure.&nbsp; It was a really awful place.&nbsp;&mdash;&mdash;

Adoption: $324.75 ($300.00 fee + $24.75 required 8.25% sales tax)
Weight: 9&nbsp;lbs.
DOB:&nbsp; 2/8/2009&nbsp;

ADOPTION APPLICATION: http://www.recycledpoms.org/application
&nbsp;
Email info@recycledpomeranians.com to request a printable application.
&nbsp;
------Please remember our group is made of only volunteers all of whom have full time jobs, foster fur-kids, and families of their own, so please be patient.---------

Look at this pudgy little face. Makes you want to pinch his little cheeks. But get to know this little guy first. It&#39;s not that he isn&#39;t a great dog; he is! He just takes a little time to warm up to people. And when he does, it is such a great feeling because he loves with all his little heart. His foster mom says it is so sweet to see him seeking love and accepting attention.&nbsp;




Meet Sisco! Sisco is an almost 7-year-old, 16-pound, neutered male Chihuahua mix. He has a gorgeous, short, tan and white coat. He is house and crate trained (but his foster says Sisco spent too much time in a crate prior to his rescue, and he is fine out of his crate&mdash;so, she seldom crates him). &nbsp;And he walks very nicely
&nbsp;on-leash&nbsp; 
but will pull a little. Because Sisco wasn&#39;t socialized when younger, he tolerates other dogs but doesn&#39;t really interact. So Sisco will make a great only dog.





Sisco will need a patient adopter who will give him time to adjust to a new environment, and he will reward you by bestowing his love and allowing you to see him blossom into a sweet, loving, little guy. &nbsp;Sisco does have diabetes, but his condition is easily treated by insulin shots twice a day. &nbsp;And he does well with little ones who are good with dogs; he seems fascinated by them and&nbsp;follows them around (but supervise them so Sisco doesn&#39;t get hurt). &nbsp;





You can apply to adopt Sisco at the website shown below.&nbsp;


&nbsp;


An Adoption Application for this dog can be found and submitted online at http://www.angelsrescue.org/adopt/adoption-forms&nbsp;

For inquiries, email inquiry@angelsrescue.org

Please be sure to like our Facebook page https://www.facebook.com/angelsrescue.

Mishi is a black female kitten who was trapped by Amy Zane in her yard.&nbsp; Amy fostered Mishi and her 2 siblings (Mila &amp; Bootsie).&nbsp;&nbsp;

Mishi

Mishi was the third and last of her litter to brave approaching her fosterers.
&nbsp;&nbsp;
Her fosterers sat out in one of the coldest November days trying to coax her with yummy food.
&nbsp;&nbsp;
After many hours they were ready to leave
&nbsp;&nbsp;
and give up for the day and just then Mishi went into the carrier to start her new life.
&nbsp;&nbsp;
During her time in
&nbsp;&nbsp;
foster care she has been the same way- holding out for long periods but then giving in at the last minute. She is worth every single moment of waiting though.
&nbsp;&nbsp;
She has a remarkable calming presence and loves cuddling once she&rsquo;s accustomed to her surroundings.
&nbsp;&nbsp;
She is even more likely to want to lay quietly being pet if her person is singing softly or willing to rub her shoulders.&nbsp;
&nbsp;Her favorite song is &quot;Bring your love to me&quot; by the Avett Brothers, sung emotively- it&#39;s her favorite.


Mishi loves to play with toys- and especially likes bigger soft kitty toys that she can carry into her bed and sleep with.&nbsp;
&nbsp;&nbsp;
She has hidden talents too.
&nbsp;&nbsp;
Her fosterers were confounded repeatedly because her water bowl would be so low after filling it just a short time before but after asking her so many times why her bowl was so low she showed them how she would rear up and come down with both legs into the water in order to make the biggest splash of droplets as she could so she could then leap up to try to catch them.
&nbsp;&nbsp;
She was doing cat &ldquo;cannon balls&rdquo; in the water bowl all in the name of fun!
&nbsp;&nbsp;
She now plays with other toys instead of her water bowl but she maintains her playfulness despite her otherwise quiet demeanor.
&nbsp;&nbsp;
She is a real character always doing the unexpected in the name of sport so her new owners will have to spend time playing as well as giving in to her demands for cuddling time.


&nbsp;
In a new home Mishi will hide at first if given the opportunity.
&nbsp;&nbsp;
She does best starting in out in a smaller more confined area then being allowed into new rooms gradually.
&nbsp;&nbsp;
In foster care she enjoyed a cat hammock but a cat tree with a hidey-hole or some other area off the ground in a small room would give her the most confidence at first.
&nbsp;&nbsp;
Mishi&rsquo;s person(s) will need have patience and be willing to put in time to gain her trust and not take her tendency to hide personally.
&nbsp;&nbsp;
Consistency is important with her.&nbsp;
&nbsp;&nbsp;
She will
&nbsp;&nbsp;
need continual positive experiences until she gains her confidence in a new environment.
&nbsp;&nbsp;
After that hurdle she will seek out attention and be perfectly happy to cuddle up next to you or on top of you whenever she has the opportunity to do so.
&nbsp;&nbsp;
She will be just as outgoing as any other lovey kitty if she is allowed to go through her routine of slow exploration and acclimation.&nbsp;
&nbsp; &nbsp;


Mishi did enjoy her siblings and would be happy to go home with one or both of them but barring that would do well with another feline or a lazier dog after a slow introduction but she will still need some amount of one on one interaction with her people daily.&nbsp;
&nbsp;

Mila is a black female kitten who was trapped by Amy Zane in her yard along with 2 other siblings (Bootsie &amp; Mishi).&nbsp;&nbsp;

Mila

&nbsp;

Mila has a very sweet disposition and is very fond of laps.&nbsp; 
&nbsp;&nbsp;
She would be fantastic in a home where people sit to binge watch their favorite shows or read. 
&nbsp;&nbsp;
She will likely spend a lot of time next to you with her arm and head draped over your leg or completely curled up on your lap. 
&nbsp;&nbsp;
And she&rsquo;s happy to nap right alongside you if you happen to doze off. 
&nbsp;&nbsp;
Mila&rsquo;s ideal home would be one where she is allowed to sleep in the bed with her people. 
&nbsp;&nbsp;
She is willing to share with another pet as well. 
&nbsp;&nbsp;
If Mila could speak human language she would learn the word for &ldquo;lap&rdquo; from every country.&nbsp; 
&nbsp;


If your lap is not available she is happy to explore and make her own fun. 
&nbsp;&nbsp;
She likes sitting in a window looking at birds or playing with any kind of toy.&nbsp; 
&nbsp;&nbsp;
if you go away for a little vacation she will do fine on her own or with her furry friends making her own fun but upon your return she&rsquo;s going to be waiting for you to sit for her so she can claim your lap again.&nbsp;&nbsp;

&nbsp;

Mila is a stunning looking cat with her long legs and sleek coat.&nbsp; She used to enjoy laying upside down in her cat hammock with her head drooping lazily out of the hammock as if to say, &quot;yes, I am the epitome of catness.&nbsp; Know me and understand why mankind has worshipped my fellow catkin since the time of the Ubastet!&quot;&nbsp; In short, Mila thinks she&#39;s royalty and you are there to serve her.&nbsp; She will treat you well if you do indeed show her adoration and allow her all the time she needs to laze with you.

If you are interested in visiting or&nbsp;adopting, please submit an application at www.RichardsonRescue.org. Fancy does qualify for our Senior for Seniors Program. All visits require an approved application and are by APPOINTMENT ONLY.&nbsp;



Fancy is around 10 years old as of August, 2021 and weighs 16.5 pound. This little gal has a great temperament with everyone she meets. She is so loving and loves to cuddle and be in your lap. She loves her toys and naps. Fancy also gets along great with other dogs and has been around cats in her previous home with no issues. She has not been around children but we think she would do fine with older ones with her sweet personality. She is crate and house trained and walks on a leash. This girl should do well with most any type of family. She is a quiet kind of girl and would do well with apartment life also. Fancy is spayed, heartworm negative and current on shots, heartworm and flea prevention.&nbsp;


&nbsp;

&nbsp;

Elvis is a long black cat with white whiskers. He doesn&#39;t really care for kids, but does love his adult humans. He&#39;s very affectionate, talkative at times, and will follow you around. He&#39;s playful and gets along with other cats. Come meet this sweet guy and give him a chance!





&nbsp;





Adoption hours are inside PetSmart Whittier Sat &amp; Sun 12-4:30 PM.&nbsp; catsinneedpetsmartwhittier@gmail.com or&nbsp;

(562) 374-5005

Reina will be a forever foster in DRM&#39;s Program, however we would work with the right forever home for this sweet girl.

&nbsp;

Meet Reina! This girl is just 3 years old and is handicapable!

Reina was originally rescued from a high kill shelter by an all breed rescue. It was apparent she suffered from neurological issues, but nothing could be found on x-rays of her spine. DRM then stepped in and welcomed Reina into our program to get the help needed so she can thrive!&nbsp;&nbsp;

Reina was born with a condition that caused the nerves from her back legs to brain to not map completely. Sometimes she can be a bit wobbly and sometimes she suffers from incontinence. She is on a special diet that has helped a lot with her potty issues though!&nbsp;

Reina&rsquo;s favorite activities include snuggling her humans, chewing on bones, going for walks, playdates with her friends and exploring the yard. She also LOVES to chase rabbits and squirrels! When she&rsquo;s tuckered out, she&rsquo;ll sunbathe looking out the window or hang out with her foster family.&nbsp;

Reina has lived with other dogs and cats &ndash; she&rsquo;s awesome with dogs but can be very curious about her feline friends. Reina is super smart and knows all the basic commands. Her recall is great (as long as she&rsquo;s not scouting for bunnies or squirrels) and she is very food motivated to learn anything else you&rsquo;d like to teach her. She is a hit around the neighborhood with her sunny disposition and love of everyone she meets.&nbsp;

Reina would do best in a home where someone would be home with her most of the day &ndash; she loves to snuggle! She loves everyone she meets so she&rsquo;s not picky &ndash; she just needs someone to make her world complete. Could that be you?&nbsp;

This fabulous foster is a Doberman Rescue Minnesota foster dog.

Please read all adoption steps and policies&nbsp;carefully on our website.&nbsp;http://dobermanrescueminnesota.com/adoption-steps/

Qualified adopters are within the approved adoption area, and&nbsp;Adopter will be requested to visit this foster dog at the foster family home. Our foster families are generally located within a 250 mile radius of Minneapolis, MN.

All DRM dogs are spayed/neutered, vaccinated, health checked, microchipped, dewormed, 4DX tested, and on monthly flea/tick and heartworm prevention.&nbsp;

RJ came to us from Texas&nbsp;and he was quickly adopted. Unfortunately, his owners have fallen on hard times and are left with no other option than to return RJ to us. Rj is now 5 1/2 years old, weighs 16 pounds and is a Chihuahua/Dachshund mix.

RJ&nbsp;has your typical Chihuahua personality - he loves his people and wants to be a cuddle bug, but isn&#39;t the biggest fan of strangers. This is due to him being scared as he reacts the same way to other animals. He doesn&#39;t like people or animals in his face, so children are a &quot;no&quot; for him as well. RJ would love a quiet home as he is a low energy, mellow guy that does well with his immediate family!&nbsp;

If you are interested in RJ, visit EHRDOGS.ORG and fill out an application for RJ LONESTAR!!!!!

Cloud, about 4 years old, is a&nbsp;Boxer mix rescued from a North Carolina&nbsp;kill shelter, emaciated and suffering from a life of neglect. She is a beautiful little petite pixie - 40 pounds of dynamite: a big personality in a small package!&nbsp; She&#39;s a total love bug and very affectionate with her people. She&#39;s&nbsp; 


house trained, crate trained,&nbsp;has great leash manners and&nbsp;knows basic commands. 



Extremely smart,&nbsp;Cloud learns quickly and is eager to please. A high-
energy girl, she&nbsp;requires daily exercise and stimulation. A fenced-in yard is a must.&nbsp; 
She is very dog-selective and although she tends to do


