Sacramento- Squish&nbsp;came to us originally as a baby,&nbsp; when this litter of puppies was left in a tub outside of a spay and neuter clinic.&nbsp; He was barely four weeks old and required formula in addition to watered down canned food.&nbsp; He had a head injury and we were not sure he would survive, but he kept fighting and within a matter of a month, he was the same as his three siblings.&nbsp; Squish was adopted when he was about three months old, but when he was about 6 months old, he started to exhibit anxious behaviors.&nbsp; Rather than work with him and a trainer, his adoptive family decided to return him.&nbsp; When Squish came back to us, he was a bit of a mess.&nbsp; He did not trust strangers at all, and he would not go into a crate.&nbsp; We were able to work through a lot of his fears and he was crate trained once again. He learned basic obedience, but he continued to live with extremely high anxiety.&nbsp; We had Squish evaluated and made the decision to try prozac.&nbsp; It took a couple months to figure out his correct dose, but he was suddenly a more relaxed version of himself, and he was much happier.&nbsp; Squish continues to take prozac, which is minimal in cost (he will be sent to his new home with quite a bit, too).


&nbsp;


Squish then participated in a board and train program for a couple weeks to work on his lack of confidence.&nbsp; He has improved quite a bit, but he continues to require to proper introductions to new people and situations, and really would prefer a quiet home without children, so he can be his best, most relaxed self.&nbsp; He is not a coffee shop dog, he does not need fieldtrips and outtings.&nbsp; He is most happy at home, with his people.&nbsp; He LOVES balls.&nbsp; Fetch, soccer, and more. Anything for a chance to play with big rubber balls.&nbsp; He does not really understand tug-of-war, he would much rather fetch a ball or kick it around.&nbsp;&nbsp;


&nbsp;


Yes, Squish is nervous and takes time to warm up, but once he does, he will be your biggest admirer and your best friend. He is worth the patience and time and love to build his trust, because he is the sweetest boy to ever be, and is 95 lbs of dopey love.&nbsp; Also, he has the cutest little docked knub (he came that way, at just 4 weeks) and it wiggles so fast when he is happy! It is worth everything to see that.


&nbsp;


He is neutered, microchipped, and up to date on vaccines.&nbsp;


